import React from 'react'
import logo from './Images/notes.jpg'

const Header = () => {
  return (
    <>
     <div className="header">
         <img src={logo} alt="logo" width='50px' height='50' />
         <h1>Keep here</h1>
         <div className="text-left">
         <h1>Time</h1>
         </div>
     </div>
    </>
  );
};
export default Header;
